        tld: str,
    ) -> None:
        if TestAllTld is True:
            hint = whois.getTestHint(tld)
            hint = hint if hint else f"meta.{tld}"
            rr.append(f"{hint}")
        else:
            rr.append(f"meta.{tld}")

    rr: List[str] = []
